import logo from './logo.svg';
import './App.css';
import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEdit, faTrashAlt } from '@fortawesome/free-solid-svg-icons';
import { Button, Modal, ModalBody, ModalFooter, ModalHeader } from 'reactstrap';
import { Component } from 'react';

const url = "https://localhost:7051/ProductAll";

class App extends Component {
  state = {
    data:[]
  }

  peticionGet=() => {
    axios.get(url).then(response => {
      this.setState({data: response.data});
    })
  }

  componentDidMount() {
    this.peticionGet();
  }
  render() {
    return (
     <div className="App">
      <br />

      <button className="btn btn-success">Agregar Producto</button>
      <br /> <br />
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>name</th>
            <th>description</th>
            <th>category</th>
            <th>stock</th>
            <th>price</th>
          </tr>
        </thead>
        <tbody>
          {this.state.data.map(producto => {
            return(
              <tr>
                <td>{producto.id}</td>
                <td>{producto.name}</td>
                <td>{producto.description}</td>
                <td>{producto.category}</td>
                <td>{producto.stock}</td>
                <td>{new Intl.NumberFormat("en-EN").format(producto.price)}</td>

                <td>
                      <button className="btn btn-primary" ><FontAwesomeIcon icon={faEdit}/></button>
                      {"    "}
                      <button className="btn btn-primary" ><FontAwesomeIcon icon={faTrashAlt}/></button>
                </td>
              </tr>

            )
          })}
        </tbody>
      </table>
      <Modal>
              <ModalHeader style={{display: 'block'}}>
                <span style={{float: 'right'}}>X</span>
              </ModalHeader>

              <ModalBody>
                <div className="form-group">
                  <label htmlFor="id">ID</label>
                  <input className="form-control" type='text' name='id' id='id' readOnly/>
                  <br/>
                  <label htmlFor="nombre">NAME</label>
                  <input className="form-control" type="text" name="nombre" id="nombre" />
                  <br/>

                </div>
              </ModalBody>
      </Modal>



     </div>
    );
  }
}


export default App;
